r($,"aGj","agi",()=>A.a([A.n9("Owl coder is an Innovative Training Program of 60 days which enhances trainees on Coding skills like Data Structures and Algorithms, Problem solving skills, Aptitude, Reasoning and Soft skills. This training happens from 4.00p.m to 12.00a.m. Trainees are given awareness on Interview skills and conducted Mock interviews on both Technical and HR rounds. It was proven a successful initiative by our CEO which reflected on the placements of highest packages.","assets/IMG/OC.png","Owl Coder","assets/VID/OV.mp4"),A.n9("Project space is a feature rich environment designed to encourage individuals to develop and showcase real-time problems and further find effective solutions that can help overcome them. Every individual who chooses to utilize this space pockets themselves a chance that could possibly get them one step closer to their dream job.","assets/IMG/PS.png","Project Space","assets/VID/PSV.mp4"),A.n9("T-Connect is an event that gives freshmen a chance to connect with various emerging technologies. Individuals who choose to attend the program are given the opportunity to explore and experience various emerging technologies like cloud computing, networking, coding, artificial intelligence, augmented reality, virtual reality and robotics. They are briefed about the importance of the technology and the opportunities they bring and are allowed to eventually choose a career path that best suits them.","assets/IMG/TC.png","T-Connect","assets/VID/TV.mp4"),A.n9("Drive Ready is a program designed to help attendees familiarize themselves with a technology and coding language of their choice. This hybrid mode of training ensures that every attendee is ready to ace every interview they attend. The trainings offered in this program are usually job specific and is designed to help the attendee acquire the adequate skills required to efficiently begin their career.","assets/IMG/DR.png","DriveReady","assets/VID/DRV.mp4"),A.n9("Code Mind is a platform that focuses on crafting a skilled individual. Our unique and interactive scenario based learning modules are designed to help a student look at a problem in a life like perspective. We strongly believe that every mind isn\u2019t alike, and therefore we give the student a chance to express their opinion rather than trying to abide by a generalized one. The platform also guides students on how they should proceed with their goals and helps them prepare for their dream job in a personalized way.","assets/IMG/CM.png","Codemind","assets/VID/CV.mp4"),A.n9("Feeling anxious about your upcoming interview? Our team of seasoned professionals is at your disposal, ready to provide comprehensive guidance and equip you with the essential tools to excel in every stage of your interview through this program. Through this program every individual gets an opportunity enhancing their skills and gets the knowledge on facing the interview better.","assets/IMG/insidee.png","InsideOut","assets/VID/inside.mp4"),A.n9(" The most recent technological training has brought about a transformative shift in the educational landscape, empowering each individual on campus to enhance their learning capabilities. Enthusiastic tech aficionados are buzzing with anticipation and achieving remarkable success in various domains. This exclusive T News powered by Technical Hub bulletin delivers comprehensive updates on activities, training programs, placement records, and more, fostering not only students academic growth but also nurturing their communication prowess","assets/IMG/T-news.png","T-NEWS","assets/VID/T-news.mp4"),A.n9("We provide internships to our qualified trainees within the campus and help them exercise their skills and work together with our senior team members to gain the right skills in their domain. In addition to mentoring and support we also provide a decent stipend to all our interns to compensate for their contribution towards our team. Upon completion of their internships, trainees are given a service certification and are also offered full time positions based on their performance during their tenure with us.","assets/IMG/INTERN.png","Internship","assets/VID/IV.mp4")],A.a3("v<GJ>")))
